import React from 'react';
import { PageContainer, PageTitleOne, PageTitleTwo, PageText, PageAnchorTag } from '../global-page-styles/global-page-styles';
import { CustomButton } from '../../components/custom-button/custom-button.component';
import {Helmet} from "react-helmet";

const AboutPage = (props) =>{

  return (
    <PageContainer>
    <Helmet>
        <title>About</title>
        <meta name="about" content="About Dale Street Studio, LLC" />
    </Helmet>
    <PageTitleOne className='date'>About</PageTitleOne>
    <PageTitleTwo>Description</PageTitleTwo>
    <PageText>Dale Street Studio is home to recording artist Marcus Dale Norwood aka M.D. Norwood. With his expanding studio, growing sound and 20+ years of experience in audio between production, mixing & mastering services. In addition to his emerging sound as a singer/songwriter/guitarist.
    </PageText>
    <PageTitleTwo>Booking</PageTitleTwo>
    <PageText style={{marginBottom: '45px'}}>Most of the time I'm locked away recording or writing something for my projects. Although I also love helping other artists success in their sound. So I offer production, mixing, mastering and audio cleanup. In addition to guitar, scratch and vocals. 
    </PageText>
    <center><CustomButton style={{textAlign: 'center'}}><a href={'http://eepurl.com/hyqpfb'}><span role="img" aria-label="shop">&#x1f4b8;</span>Contact to Book Services</a></CustomButton> </center>


    </PageContainer>
  )
};




export default React.memo(AboutPage);
